const initialState = {
    transactions: [
       {id:1,
        text: "Hello",
        singleAmount: 100
    },   {id:2,
        text: "Helloa",
        singleAmount: 1020
    },   {id:1,
        text: "Hello",
        singleAmount: 100
    }
    ]
}

const rootExpenceTrackerReducer = (state = initialState, action) => {
    switch(action.type){

        default:
             return state
    }
} 
export default rootExpenceTrackerReducer
